import { makeStyles } from '@material-ui/core';
import React from 'react';
import './../css/fonts.css';
import Navegation from './Navegation';
import Card from './Card';

const useStyles = makeStyles(()=>({
    members:{
        
        margin:'81px 0 0 85px',
        width:'100%',
        display:'flex',
        flexDirection:'column'
        
    },
    titleElection:{
        margin:'20px 0 0',
        textAlign:'center',
        fontSize:'40px',
        fontFamily: 'Rubik, sans-serif',
        fontWeight:'bold'
    },
    subTitleElection:{
        width:'75%',
        margin:'20px auto 0',
        padding:'0 0 0 5px',
        borderLeft:'3px solid #5A2120',
        display:'flex',
        fontSize:'20px',
        fontWeight:'bold',
        "& div":{
            width:'25px',
            height:'25px',
            border:'1px solid #5A2120',
            display:'flex',
            justifyContent:'center',
            alignItems:'center',
            margin:'0 5px'
        }
    },
    membersContainer:{
        background:'green',
        margin:'20px auto ',
        display:'flex',
        flexDirection:'row',
        flexWrap:'wrap',
        justifyContent:'center',
        width:'75%'
    },
    cardContainer:{
        margin:'0 20px 25px'
    }

}));

const Members = () => {
  const classes = useStyles();
  return (
      <React.Fragment>
        <Navegation />
        <div className={classes.members}>
            <div className={classes.titleElection}>ELECCIONES RECTORALES 2021</div>
            <div className={classes.subTitleElection}>Integrantes de la lista <div>1</div> </div>
            <div className={classes.membersContainer}>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                <div className={classes.cardContainer}>
                    <Card />
                </div>
                
            </div>
        </div>
      </React.Fragment>
    
  );
}

export default Members;
